import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import './signup.scss';
function Signup() {
    const [email,setemail]=useState('');
    const [password,setpassword]=useState('');
     const[name,setname]=useState('')
     function handelsubmit(e){
        e.preventDefault();
        axios.post('http://localhost:3000/api/v1/login',{email,password})
        .then(res=>console.log(res))
        .catch(err=>console.log(err));
     }
  return (
<div className='signup'>
<div className="signup-box">
    <h2 className='heading'>Sign Up</h2>
    <form onSubmit={handelsubmit}>

    <label htmlFor="name">Name</label>
        <input type="text" className='name' id="name" onChange={(e)=>{
            setname(e.target.value)
        }} />
        <label htmlFor="email">Email</label>
        <input type="text" className='email' id="email" onChange={(e)=>{
            setemail(e.target.value)
        }} />

        <label htmlFor="password">Password</label>
        <input type="password" className='password' id='password' onChange={(e)=>{
            setpassword(e.target.value)
        }} />


        <input type="submit" className='submit' />
    </form>
    <p>Already have an account?<Link to="/login">Login</Link></p>
</div>
</div>
  )
}

export default Signup
